<!DOCTYPE html>
<html>
<head>
<meta charset="utf-8">
<style>
:root {
    overflow: hidden;
}
     
.svg {
    background-color: white;
}
     
.node text {
  font-size: 10px;
  font-family: sans-serif;
}
   
.node circle {
    fill: #457118;
    stroke: #457118;
    stroke-width: 1px;
}
 
path {
    fill: none;
    stroke: #ccc;
    stroke-width: 1px;
}
</style>
<style>
div#placeholder {
    position: absolute;
    top:  50%;
    left: 50%;
    transform: translate(-50%,-50%); 
    font: 20px sans-serif;
    color: rgb(180, 180, 180);
    font-weight: 700;
    line-height: 34px;
    margin: 0 auto;   
    text-align: center;
}
</style>
<style>
.d3-context-menu {
	position: absolute;
	display: none;
	background-color: #f2f2f2;
	border-radius: 4px;

	font-family: Arial, sans-serif;
	font-size: 14px;
	min-width: 150px;
	border: 1px solid #d4d4d4;

	z-index:1200;
}

.d3-context-menu ul {
	list-style-type: none;
	margin: 4px 0px;
	padding: 0px;
	cursor: default;
}

.d3-context-menu ul li {
	padding: 4px 16px;
}

.d3-context-menu ul li:hover {
	background-color: #73b72b;
	color: #fefefe;
}
</style>
<style>
div.tooltip {
    text-align: left;
}

div.tooltip ul {
    padding: 0;
    margin: 0;
    list-style-type: none;
    line-height: 1.2em;
    font-size: 14px;
}

.d3-tip {
    word-wrap: break-word;
    max-width: 500px;
    line-height: 1;
    padding: 12px;
    background: #73b72b;
    color: #ffffff;
    border-radius: 3px;
    font-family: sans-serif;
    box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19);
}

 /* Creates a small triangle extender for the tooltip */
 .d3-tip:after {
     box-sizing: border-box;
     display: inline;
     font-size: 10px;
     width: 100%;
     line-height: 1;
     color: #73b72b;
     content: "\25BC";
     position: absolute;
     text-align: center;
 }

 /* Style northward tooltips differently */
 .d3-tip.n:after {
     margin: -1px 0 0 0;
     top: 100%;
     left: 0;
 }
</style>
</head>

<body>
  <svg class="svg">
    <g></g>
  </svg>
  <div id="placeholder"></div>
</body>
